function bouncedCheckout() {
    if (this.checkoutTimeout) clearTimeout(this.checkoutTimeout);
    var checkout = function() {
        var rev = Math.ceil(this.getValue() * this.maxRev);
        if (rev < 1) rev = 1;
        this.get("SyncManager").wc.loadRev(rev);
    }.bind(this);
    this.checkoutTimeout = setTimeout(checkout, 400);
}

