function showInfo(info) {
    var txt = this.get("SyncManagerChannelInfoText");
    txt.textString = '';
    function formatDate(s) { return new Date(s).toLocaleString().truncate(33, ''); }
    function formatBytes(n) { return Math.floor(n / 1024) + " KB"; }
    function formatContrib(n) { return Math.floor(100 * n / info.rev) + "%"; }
    function addField(lbl, val) {
        txt.appendRichText(lbl + "\n", {fontWeight: 'bold'});
        txt.appendRichText(val + "\n\n", {});
    }
    txt.appendRichText(info.name + "\n\n", {fontWeight: 'bold', fontSize: 12});
    addField("current version ", info.rev);
    addField("created ", formatDate(info.created));
    addField("last changed ", formatDate(info.latest));
    addField("data size ", formatBytes(info.bytes));
    txt.appendRichText("contributors\n", {fontWeight: 'bold'});
    info.contributors.each(function(ea) {
        txt.appendRichText(ea.name, {});
        txt.appendRichText(" (" + formatContrib(ea.revisions) + ")\n", {italics: 'italic'});
    });
    txt.appendRichText("\njoin", {
        fontWeight: 'bold',
        uri: "/repository/webwerkstatt/users/cschuster/join.xhtml?c=" + info.name});
    txt.fit();
    var slider = this.get("SyncManagerTimeSlider");
    slider.maxRev = info.rev;
    slider.setPosition(pt(0, 40000));
    slider.setValue(0);
    this.addMorph(slider);
    slider.setVisible(true);
}

