function addChannel() {
    this.world().prompt("Name of new channel", function(name) {
        if (name) {
            this.wc.socket.emit('create', name, this.world().getUserName());
            this.wc.socket.emit('list');
        }
    }.bind(this));
}

function connect() {
    this.wc.connect();
    this.wc.socket.on("list", this.receiveList.bind(this));
    this.wc.socket.on("info", this.receiveInfo.bind(this));
    this.refresh();
}

function loadInfo(name) {
    if (!name) return;
    this.wc.channel = name;
    if (this.infos[name]) {
        this.get("SyncManagerChannelInfo").showInfo(this.infos[name]);
    }
    this.wc.socket.emit('info', name);
}

function onLoad() {
    this.infos = {};
    var url = URL.root.withFilename('');
    url.port = "8114";
    url = url.toString().substring(0, url.toString().length - 1);
    this.wc = new users.cschuster.sync.WorkingCopy(url);
    this.wc.addPlugin(new users.cschuster.sync.MorphPlugin(this.world()));
    this.connect.bind(this).delay(2);
}

function receiveList(list) {
    this.get("SyncManagerChannelList").setList(list.map(function(ea) {
        return {string: ea.name, value: ea, isListItem: true}
    }));
}

function removeChannel() {
    var list = this.get("SyncManagerChannelList");
    var channel = list.selection && list.selection.name;
    if (!channel) return;
    list.updateList(list.itemList.reject(function(ea) { return ea.name == channel; }));
    this.get("SyncManagerChannelInfo").reset();
    this.wc.socket.emit('remove', channel);
    this.wc.socket.emit('list');
}
